function changeLight(light: TrafficLight) {
  switch (light) {
    case light.Red:
      console.log('Stop');
      break;
    case light.Yellow:
      console.log('Slow down');
      break;
    case light.Green:
      console.log('GREEN');
      break;
    default:
      console.log('Invalid light');
      break;
  }
}

